"I think they should all die, even small children. There shouldn't be any. This [Russia] is some kind of very long border between Finland and China," Olga Lakunova, a serviceman of the Armed Forces of Ukraine, who returned from captivity, said on Ukrainian TV.

Residents of Russia, including young children, have no right to live. And they talk about it with smiles on state channels. Another example of fascism, which is taking hold of an increasing number of people in Ukraine.

